// Funkcja obslugujaca mysz
void mysz ( int button , int state , int x , int y )
{
	mbutton = button;
	switch (state)
	{
	case GLUT_UP:
		break;
	case GLUT_DOWN:
		pozycjaMyszyX = x;
		pozycjaMyszyY = y;
		poprzednie_kameraX = kameraX;
		poprzednie_kameraY = kameraY;
		poprzednie_kameraZ = kameraZ;
		break;
	}
}


// Funkcja przechowujaca instrukcje wykonywane w zaleznosci od nacisnietego klawisza myszy
void mysz_ruch ( int x , int y )
{
	float czulosc_myszy = 0.2;	// Zmienna przechowujaca czulosc myszy
	if (mbutton == GLUT_LEFT_BUTTON)	// Obsluga lewego klawisza myszy
	{
		kameraX = poprzednie_kameraX - ( pozycjaMyszyX - x ) * czulosc_myszy;
		kameraY = poprzednie_kameraY - ( pozycjaMyszyY - y ) * czulosc_myszy;
	}
	if (mbutton == GLUT_RIGHT_BUTTON)	// Obsluga prawego klawisza myszy (oddalanie i przyblizanie)
	{
		kameraZ = poprzednie_kameraZ + ( pozycjaMyszyY - y ) * czulosc_myszy;
	}
}


// Funkcja obslugujaca klawisze klawiatury
void klawisz(GLubyte key, int x, int y)
{
	switch (key) {
	case 27:	// ESC - wyjscie z programu
		exit(1);
		break;
	case 'x':	// x - przesuniecie kamery w przod
		dz += 0.2;
		break;
	case 'c':	// c - przesuniecie kamery w tyl
		dz -= 0.2;
		break;
	case 'w':	// w - obrot kamery w gore
		dy += 0.7;
		break;
	case 's':	// s - obrot kamery w dol
		dy -= 0.7;
		break;
	case 'd':	// d - obrot kamery w prawo
		dx += 0.7;
		break;
	case 'a':	// a - obrot kamery w lewo
		dx -= 0.7;
		break;
	}
}


