void rozmiar ( int width , int height )
{
	screen_width = width;
	screen_height = height;

	// Definicja obszaru, w ktorym beda rysowane obiekty
	glViewport ( 0 , 0 , screen_width , screen_height );

	// Tworzenie macierzy projekcji P
	// glm::perspective ( kat widzenia , stosunek szerokosci do wysokosci ekranu, odleglosc min od obserwatora, odleglosc max od obserwatora )
	P = glm::perspective ( glm::radians ( 60.0f ) , ( GLfloat ) screen_width / ( GLfloat ) screen_height , 1.0f , 1000.0f );

	glutPostRedisplay ( ); // Przerysowanie sceny
}


void idle ( )
{
	glutPostRedisplay ( );
}


