	glutCreateWindow ( "Szachy Filip Halys" );

	glewInit ( ); //init rozszerzeszeń OpenGL z biblioteki GLEW

	glutDisplayFunc(rysuj);			// def. funkcji rysujacej
	glutIdleFunc(idle);				// def. funkcji rysujacej w czasie wolnym procesoora (w efekcie: ciagle wykonywanej)
	glutReshapeFunc(rozmiar);		// def. obslugi zdarzenia resize (GLUT)

	glutKeyboardFunc(klawisz);		// def. obslugi klawiatury
	glutMouseFunc(mysz); 			// def. obslugi zdarzenia przycisku myszy (GLUT)
	glutMotionFunc(mysz_ruch);		// def. obslugi zdarzenia ruchu myszy (GLUT)


	glEnable ( GL_DEPTH_TEST );


	// Plansza
	glGenBuffers(1, &VBO3);
	glBindBuffer(GL_ARRAY_BUFFER, VBO3);
	glBufferData(GL_ARRAY_BUFFER, sizeof(wsp_planszy), wsp_planszy, GL_STATIC_DRAW);

	glGenBuffers(1, &ebo3);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo3);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(wsp_planszy_2), wsp_planszy_2, GL_STATIC_DRAW);

	// Obwodka
	glGenBuffers(1, &VBO4);
	glBindBuffer(GL_ARRAY_BUFFER, VBO4);
	glBufferData(GL_ARRAY_BUFFER, sizeof(wsp_obwodki), wsp_obwodki, GL_STATIC_DRAW);

	glGenBuffers(1, &ebo4);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo4);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(wsp_kratki_2), wsp_kratki_2, GL_STATIC_DRAW);

	// Kratka
	glGenBuffers(1 , &VBO );
	glBindBuffer(GL_ARRAY_BUFFER, VBO);
	glBufferData(GL_ARRAY_BUFFER, sizeof(wsp_kratki), wsp_kratki, GL_STATIC_DRAW);

	glGenBuffers(1 , &ebo);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(wsp_kratki_2), wsp_kratki_2, GL_STATIC_DRAW);

	glGenBuffers(1, &vtex);
	glBindBuffer(GL_ARRAY_BUFFER, vtex);
	glBufferData(GL_ARRAY_BUFFER, sizeof(mnozenie_tekstury), mnozenie_tekstury, GL_STATIC_DRAW);


	// Lampka
	glGenBuffers(1, &VBO2);
	glBindBuffer(GL_ARRAY_BUFFER, VBO2);
	glBufferData(GL_ARRAY_BUFFER, sizeof(wsp_lampki), wsp_lampki, GL_STATIC_DRAW);

	// Dodge
	glGenBuffers(1, &VBO5);
	glBindBuffer(GL_ARRAY_BUFFER, VBO5);
	glBufferData(GL_ARRAY_BUFFER, sizeof(dodge_vertices), dodge_vertices, GL_STATIC_DRAW);
	glGenBuffers(1, &ebo5);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo5);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(dodge_elements), dodge_elements, GL_STATIC_DRAW);

	// Airplane
	glGenBuffers(1, &VBO6);
	glBindBuffer(GL_ARRAY_BUFFER, VBO6);
	glBufferData(GL_ARRAY_BUFFER, sizeof(airplane_vertices), airplane_vertices, GL_STATIC_DRAW);
	glGenBuffers(1, &ebo6);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo6);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(airplane_elements), airplane_elements, GL_STATIC_DRAW);

	// Porsche
	glGenBuffers(1, &VBO7);
	glBindBuffer(GL_ARRAY_BUFFER, VBO7);
	glBufferData(GL_ARRAY_BUFFER, sizeof(porsche_vertices), porsche_vertices, GL_STATIC_DRAW);
	glGenBuffers(1, &ebo7);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo7);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(porsche_elements), porsche_elements, GL_STATIC_DRAW);

	// Statek
	glGenBuffers(1, &VBO8);
	glBindBuffer(GL_ARRAY_BUFFER, VBO8);
	glBufferData(GL_ARRAY_BUFFER, sizeof(statek_vertices), statek_vertices, GL_STATIC_DRAW);
	glGenBuffers(1, &ebo8);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo8);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(statek_elements), statek_elements, GL_STATIC_DRAW);

	// Pickup
	glGenBuffers(1, &VBO9);
	glBindBuffer(GL_ARRAY_BUFFER, VBO9);
	glBufferData(GL_ARRAY_BUFFER, sizeof(pickup_vertices), pickup_vertices, GL_STATIC_DRAW);
	glGenBuffers(1, &ebo9);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo9);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(pickup_elements), pickup_elements, GL_STATIC_DRAW);
	
	// Helikopter
	glGenBuffers(1, &VBO10);
	glBindBuffer(GL_ARRAY_BUFFER, VBO10);
	glBufferData(GL_ARRAY_BUFFER, sizeof(helikopter_vertices), helikopter_vertices, GL_STATIC_DRAW);
	glGenBuffers(1, &ebo10);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo10);
	glBufferData(GL_ELEMENT_ARRAY_BUFFER, sizeof(helikopter_elements), helikopter_elements, GL_STATIC_DRAW);

	// Dolaczanie Shaderow
	programID  = loadShaders ( "vertex_shader.glsl" , "fragment_shader.glsl"  );
	programID2 = loadShaders ( "vertex_shader.glsl" , "fragment_shader2.glsl" );
	programID3 = loadShaders ( "vertex_shader.glsl" , "fragment_shader3.glsl" );


	// Dolaczanie cech oswietlenia
	objectColor_id = glGetUniformLocation(programID, "objectColor");
	lightColor_id = glGetUniformLocation(programID, "lightColor");
	lightPos_id = glGetUniformLocation(programID, "lightPos");
	viewPos_id = glGetUniformLocation(programID, "viewPos");


	// Wczytanie tekstury kratki
	tex_id0 = WczytajTeksture ( "plansza_2x2.bmp" );
	// Sprawdzenie czy tekstura istnieje, jesli nie, wyskakuje informacja
	if (tex_id0 == -1)
	{
		MessageBox(NULL, "Brak wczytanej tekstury o nazwie: plansza_2x2.bmp", "ERROR", MB_OK | MB_ICONERROR);
		exit ( 0 );
	}

	glGenVertexArrays ( 8 , VAO );
	
	// Kratka
	glBindVertexArray(VAO[0]);
	glBindBuffer(GL_ARRAY_BUFFER,vtex);
	glEnableVertexAttribArray(1);
	glVertexAttribPointer(1, 2, GL_FLOAT, GL_FALSE, 0, 0);

	glBindBuffer ( GL_ARRAY_BUFFER , VBO );
	glBindBuffer ( GL_ELEMENT_ARRAY_BUFFER , ebo );
	glEnableVertexAttribArray ( 0 );
	glVertexAttribPointer ( 0 , 3 , GL_FLOAT , GL_FALSE , 6 * sizeof(float), ( void* ) 0 );

	glEnableVertexAttribArray(3);
	glVertexAttribPointer(3, 3, GL_FLOAT, GL_FALSE, 6 * sizeof(float), (void*)0);

	// Plansza
	glBindVertexArray(VAO[1]);
	glBindBuffer(GL_ARRAY_BUFFER, VBO3);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo3);
	glEnableVertexAttribArray(0);
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, (void*)0);

	// Obwodka
	glBindVertexArray(VAO[2]);
	glBindBuffer(GL_ARRAY_BUFFER, VBO4);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo4);
	glEnableVertexAttribArray(0);
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, (void*)0);

	// Dodge
	glBindVertexArray(VAO[3]);
	glBindBuffer(GL_ARRAY_BUFFER, VBO5);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo5);
	glEnableVertexAttribArray(0);
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, (void*)0);

	// Airplane
	glBindVertexArray(VAO[4]);
	glBindBuffer(GL_ARRAY_BUFFER, VBO6);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo6);
	glEnableVertexAttribArray(0);
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, (void*)0);

	// Porsche
	glBindVertexArray(VAO[5]);
	glBindBuffer(GL_ARRAY_BUFFER, VBO7);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo7);
	glEnableVertexAttribArray(0);
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, (void*)0);

	// Statek
	glBindVertexArray(VAO[6]);
	glBindBuffer(GL_ARRAY_BUFFER, VBO8);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo8);
	glEnableVertexAttribArray(0);
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, (void*)0);

	// Pickup
	glBindVertexArray(VAO[7]);
	glBindBuffer(GL_ARRAY_BUFFER, VBO9);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo9);
	glEnableVertexAttribArray(0);
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, (void*)0);

	// Helikopter
	glBindVertexArray(VAO[8]);
	glBindBuffer(GL_ARRAY_BUFFER, VBO10);
	glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, ebo10);
	glEnableVertexAttribArray(0);
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 0, (void*)0);


	// normal attribute
	//glVertexAttribPointer(3, 3, GL_FLOAT, GL_FALSE, 6 * sizeof(float), (void*)(3 * sizeof(float)));
	//glEnableVertexAttribArray(1);

	// second, configure the light's VAO (VBO stays the same; the vertices are the same for the light object which is also a 3D cube)
	lamp_ID = loadShaders("lamp_vshader.glsl", "lamp_fshader.glsl");
	glGenVertexArrays(1, &lightVAO);
	glBindVertexArray(lightVAO);

	glBindBuffer(GL_ARRAY_BUFFER, VBO2);
	// note that we update the lamp's position attribute's stride to reflect the updated buffer data
	glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 6 * sizeof(float), (void*)0);
	glEnableVertexAttribArray(0);

	glutMainLoop ( );					// start

	// Usuwanie rysunkow
	glDeleteBuffers(1, &VBO);
	glDeleteBuffers(1, &ebo);
	glDeleteBuffers(1, &vtex);
	glDeleteBuffers(1, &VBO2);
	glDeleteBuffers(1, &ebo2);
	glDeleteBuffers(1, &VBO3);
	glDeleteBuffers(1, &ebo3);
	glDeleteBuffers(1, &VBO4);
	glDeleteBuffers(1, &ebo4);
	glDeleteBuffers(1, &VBO5);
	glDeleteBuffers(1, &ebo5);
	glDeleteBuffers(1, &VBO6);
	glDeleteBuffers(1, &ebo6);
	glDeleteBuffers(1, &VBO7);
	glDeleteBuffers(1, &ebo7);
	glDeleteBuffers(1, &VBO8);
	glDeleteBuffers(1, &ebo8);
	glDeleteBuffers(1, &VBO9);
	glDeleteBuffers(1, &ebo9);
	glDeleteBuffers(1, &VBO10);
	glDeleteBuffers(1, &ebo10);

	glDeleteBuffers(9, VAO);

	glDeleteVertexArrays(1, &lightVAO);

	return( 0 );

